import React from 'react'
import Header from '../header/Header'
import "./Home.css"
import { motion } from 'framer-motion'

const Home = ({ languages }) => {
  return (
    <motion.div
        initial={{opacity: 0}}
        animate = {{opacity: 1}}
        transition ={{ duration: 0.75}}
        className="appBar">
            <Header languages={languages} />
    </motion.div>
  )
}

export default Home
